<h1 class="entry-title">
<a href="http://konkurs.przystan.warszawa.pl/?p=96" rel="bookmark">Wybrane!</a>
</h1>

<div class="entry-meta">
<span class="date"><a href="http://konkurs.przystan.warszawa.pl/?p=96" title="Bezposredni odnosnik do &#8222;Wybrane!&#8221;" rel="bookmark"><time class="entry-date" datetime="2017-11-15T16:35:25+00:00">Listopad 15, 2017</time></a></span><span class="categories-links"><a href="http://konkurs.przystan.warszawa.pl/?cat=6" rel="category">Kalendarz 2018</a></span><span class="author vcard"><a class="url fn n" href="http://konkurs.przystan.warszawa.pl/?author=1" title="Zobacz wszystkie wpisy, ktorych autorem jest fata" rel="author">fata</a></span>					</div><!-- .entry-meta -->
</header><!-- .entry-header -->

<div class="entry-content">
<p>&nbsp;</p>
<p>Jury w skladzie: Piotr Sadurski (fotografik), Kinga Kepa, Adam Grzegorzewski (Wioslo), Piotr Kaliszek (Przystan Warszawa) wybralo&#8230;. (ta dam werble, chwila pelnej napieci ciszy&#8230;) &#8211; kolejnosc przypadkowa:</p>
<p><a href="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/2016-07-24-056-Tarn.jpg"><img class="alignnone size-medium wp-image-97" src="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/2016-07-24-056-Tarn-300x200.jpg" alt="" width="300" height="200" srcset="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/2016-07-24-056-Tarn-300x200.jpg 300w, http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/2016-07-24-056-Tarn-768x511.jpg 768w, http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/2016-07-24-056-Tarn-1024x681.jpg 1024w" sizes="(max-width: 300px) 100vw, 300px" /></a></p>
<p><strong>Tarn</strong><br />
<strong> Piotr Kaleta</strong></p>
<p><a href="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/P1070890.jpg"><img class="alignnone size-medium wp-image-107" src="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/P1070890-300x225.jpg" alt="" width="300" height="225" srcset="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/P1070890-300x225.jpg 300w, http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/P1070890-768x576.jpg 768w, http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/P1070890-1024x768.jpg 1024w" sizes="(max-width: 300px) 100vw, 300px" /></a></p>
<p><strong>Spienione fale</strong><br />
<strong> Ivar Kim Rokke</strong></p>
<p><a href="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/Kalendarz_1.jpg"><img class="size-medium wp-image-105" src="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/Kalendarz_1-300x200.jpg" alt="" width="300" height="200" srcset="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/Kalendarz_1-300x200.jpg 300w, http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/Kalendarz_1-768x512.jpg 768w, http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/Kalendarz_1-1024x683.jpg 1024w" sizes="(max-width: 300px) 100vw, 300px" /></a></p>
<p><strong>Walcie jak w dym!</strong><br />
<strong> Agata Staszewska-Madzia</strong></p>
<p><a href="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/WP_20170805_13_42_26_Proa.jpg"><img class="alignnone size-medium wp-image-110" src="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/WP_20170805_13_42_26_Proa-300x200.jpg" alt="" width="300" height="200" srcset="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/WP_20170805_13_42_26_Proa-300x200.jpg 300w, http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/WP_20170805_13_42_26_Proa-768x511.jpg 768w, http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/WP_20170805_13_42_26_Proa-1024x682.jpg 1024w" sizes="(max-width: 300px) 100vw, 300px" /></a></p>
<p><strong>Korek na sluzie</strong><br />
<strong> Wojciech Nowak</strong></p>
<p><a href="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/IMG_3972.jpg"><img class="alignnone size-medium wp-image-103" src="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/IMG_3972-300x200.jpg" alt="" width="300" height="200" srcset="http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/IMG_3972-300x200.jpg 300w, http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/IMG_3972-768x511.jpg 768w, http://konkurs.przystan.warszawa.pl/wp-content/uploads/2017/11/IMG_3972-1024x681.jpg 1024w" sizes="(max-width: 300px) 100vw, 300px" /></a></p>
